import React from "react";

const Homepage = () => {
  return (
    <div className="container-fluid homepage-container">
      <div className="projects-container">
        <div className="project">
          <h2>DIGITAL ORGANIZER</h2>
        </div>
        <div className="project">
          <h2>DEV.LIB</h2>
        </div>
      </div>
    </div>
  );
};

export default Homepage;
